бесплатны, а потому - нет нужды переплачивать посреднику за формление на учёбу за рубеж. Проведите с пользой свои летние студенческие или школьные каникулы и сэкономьте на оплате обучения за границей.</p><br><div><a href="http://posolstvo.com/" title="Учёба в Великобритании" target="_blank"><img src="http://posolstvo.com/images/katalog.gif" alt="Учёба в Великобритании" width="81" height="31"
