<!--(1PSRU)ocenka-express.ru--><li><h2> Учет и аудит основных средств и оценка недвижимости для аудита.</h2>
<p>В процессе ознакомления с действующей системой учета основных средств студент оценщик обязан: -    изучить   порядок   документального   оформления   поступления, выбытия и перемещения основных средств и организацию аналитического и синтетического их учета.</p>
<p>Заполнить первичные документы по движению основных средств, выявить необходима ли <a href="http://www.ocenkamaster.ru/uslugi/estate/">оценка недвижимости</a>. По данным первичных документов по учету движения основных средств, составить инвентарные карточки (форма № ОС-6) по учету основных средств; - изучить    действующий    порядок    начисления    амортизации на объекты недвижимости,
произвести расчет амортизационных отчислений за отчетный период оценочной компании.</p>
<p>По данным расчета амортизационных отчислений сформировать хозяйственные операции и указать бухгалтерские регистры оценочной компании, в каких они должны найти свое отражение; -  ознакомиться с организацией ремонта основных средств в отделе главного механика и ремонтно-механическом цехе и изучить порядок определения    объема   выполненных    работ    в    единицах    ремонтной сложности.</p>
<p>В  бухгалтерии изучить  порядок  проведения оценки недвижимости, ведения  учета затрат на капитальный и текущий ремонты; порядок формирования ремонтного фонда; -  ознакомиться с порядком выявления и списания результатов от продажи и ликвидации основных средств и недвижимости;</p>
